    let fields = ["osmid", "oneway", "lanes", "name", "highway", "maxspeed", "length", "width", "bridge", "access"];

    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>

        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
